    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>The expanded/remastered version of Porkie Props by xannepan (JENX).</p>\r\n<h3>Change Log:<br><span style=\"font-size: 14px; color: #3598db;\">updated on 23.01.2024</span></h3>\r\n<ul>\r\n<li>change of readme and cleanitol location within the zip</li>\r\n<li>there wasn't any functional update or edit in the files, they stayed unchanged.</li>\r\n<li>updated description, added TAGs and images to the download page</li>\r\n</ul>\r\n<p>This prop pack replacing the following contents:</p>\r\n<ul>\r\n<li>PorkieProps-Vol1.dat</li>\r\n<li>PorkieProps-Vol2.dat</li>\r\n<li>JENXPARIS_Tweaked_PorkieProps-Vol1.dat</li>\r\n</ul>\r\n<p>It contains props/models (mostly offset props) from several Porkissimo uploads like Paramounth Opera, Rue Meyerbeer, Large Police Department, also it contains the props based on the Porkie Props vol01 models from the former <em>JENXPARIS_Prop_Pack_Vol02.dat</em>.\_</p>\r\n<p>Xannepan's note on the revisited JENXPARIS_Tweaked_PorkieProps-Vol1.dat which was released with the Quais de Seine sets:</p>\r\n<blockquote>\r\n<p>- The JENXPROP_Tweaked_PorkieProps-Vol1.dat replaces PorkieProps-Vol1.dat. I activated anti-aliasing on some of these props, which gives a better results. Additionally I created prop families to allow for some variation.</p>\r\n</blockquote>\r\n<p>Credit goes to <strong>Porkissimo </strong>for all the models and most of the props, also for <strong>Xannepan</strong> for the additional editing and props and prop families.\_<br>This compilation (and some editing) was made by Tyberius06</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Installation</span></strong>: copy/extract the Porkissimo parent folder into your Plugins.\_The \"<em>~Documents</em>\" folder contains definition files for BSC Cleanitol, to remove any older files superseded by the original MEGA Props packs.\_</p>\r\n<p>It is highly recommended to run the provided cleanitol file for the compilation with one of the following 3rd party cleanitol tools:</p>\r\n<p><a href=\"https://community.simtropolis.com/files/file/35790-sc4-cleanitol/\">nos.17 Cleanitol</a>\_(new tool)</p>\r\n<p><a href=\"/index.php/downloads/download/30-gameplay-utilities/18-bsc-cleanitol\">BSC Cleanitol\_</a>(old tool)</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/PK-street_props.jpg\" data-lightbox=\"lightbox10\" data-alt=\"lightboxPK-street_props.jpg|PK-street_trees.jpg|JENX-Porkie Expanded Porkie Props_index\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/PK-street_props.jpg\" alt=\"PK-street_props\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/PK-street_trees.jpg\" data-lightbox=\"lightbox10\" data-alt=\"lightboxPK-street_props.jpg|PK-street_trees.jpg|JENX-Porkie Expanded Porkie Props_index\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/PK-street_trees.jpg\" alt=\"PK-street_trees2\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/JENX-Porkie Expanded Porkie Props_index.png\" data-lightbox=\"lightbox10\" data-alt=\"lightboxPK-street_props.jpg|PK-street_trees.jpg|JENX-Porkie Expanded Porkie Props_index\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/JENX-Porkie Expanded Porkie Props_index.png\" alt=\"JENX-Porkie Expanded Porkie Props_index3\" ></a> </span>\r\n        </div> \r\n</body>"
