    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>After several months of development, it's finally here: the SFBT Railway Prop Pack! This download contains the engines BR 143, BR 218, BR 232, BR 185 (in three different colors), DR 243, various freight cars, passenger cars in three different colors (first and second class, plus control cars), German buffers, additional catenaries and a pylon light for sidings.</p>\r\n<p>This prop pack contains more than 40 different railway props. The props are intended for usage on rail lots and mods for SimCity 4. The pack only serves as a dependency, there are no lot or similar included. If you like to see those props in your game, you will have to install corresponding lots, or create your own. In the Lot Editor, all signals are listed with the prefix \"SFBT_Train_...\", so they are neatly grouped for easier finding. Most of the props are also available as timed versions, this is indicated by two numbers (i. e. \"7-11\" when the prop is visible from 7 AM to 11 AM) in the name.</p>\r\n<div align=\"justify\">\r\n<p class=\"text_zwischentitel\"><strong>Installation</strong>: Copy/extract the\_<strong>SFBT </strong>parent folder into your plugins folder. If you extracted the <em>_Documents </em>folders too, you don't need to keep it in your Plugins, but it is recommended to move it to a safe location for later use.\_</p>\r\n<p class=\"text_zwischentitel\"><strong>Uninstallation</strong>: <span style=\"font-size: 1rem;\">For uninstalling the files, simply delete the files from the plugins folder.</span></p>\r\n</div> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/Eisenbahnprops_01.jpg\" data-lightbox=\"lightbox118\" data-alt=\"lightboxEisenbahnprops_01.jpg|Eisenbahnprops_02\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/Eisenbahnprops_01.jpg\" alt=\"Eisenbahnprops_01\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/Eisenbahnprops_02.jpg\" data-lightbox=\"lightbox118\" data-alt=\"lightboxEisenbahnprops_01.jpg|Eisenbahnprops_02\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/Eisenbahnprops_02.jpg\" alt=\"Eisenbahnprops_022\" ></a> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
