    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>For his Berlin BATs, peterycristi created a number of props, such as historic streetlights, advertising columns, colonnades, fountains and statues.</p>\r\n<p>This prop pack contains 25 different props from Berlin and the surrounding area. The props are intended for usage on Berlin-related lots for SimCity 4. The pack only serves as a dependency, there are no lot or similar included. If you like to see those props in your game, you will have to install corresponding lots, or create your own. In the Lot Editor, all props are listed with the prefix \"SFBT_PYC_...\", so they are neatly grouped for easier finding.</p>\r\n<p class=\"text_zwischentitel\"><strong>Installation</strong>: Copy/extract the\_<strong>SFBT\_</strong>parent folder into your plugins folder. If you extracted the\_<em>_Documents\_</em>folders too, you don't need to keep it in your Plugins, but it is recommended to move it to a safe location for later use.\_</p>\r\n<p class=\"text_zwischentitel\"><strong>Uninstallation</strong>:\_For uninstalling the files, simply delete the files from the plugins folder.</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/peterycristi_Props_01.jpg\" data-lightbox=\"lightbox123\" data-alt=\"lightboxpeterycristi_Props_01\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/peterycristi_Props_01.jpg\" alt=\"peterycristi_Props_01\" ></a> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
