    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p><strong>Vortexture 1 - BaseSet</strong></p>\r\n<p>This is a set of 42new base textures for use in the Lot Editor. Included in the download are two files, namely:<br>\_\_<br>Vortexture 1 - BaseSet v1.dat ; the file which contains the actual textures<br>Vortexture 1 - demo.SC4Lot ; a lot with all 42 base textures - you will find this in the ~Documents/TEST_LOT folder</p>\r\n<p>A note to LOTters</p>\r\n<p>You may be accustomed to rotating and/or mirroring base textures in the Lot editor in order to circumvent repetitive tiling effects. This practice is not necessary with the current set, and may in fact give unsatisfactory results, because all base textures are so-called multi-fsh textures. This means each texture holds multiple variations of itself, and the game will randomly pick a variation to display. Please note, however, the variations do not show up in the Lot Editor.</p>\r\n<p><em>Disclaimer</em></p>\r\n<p>Textures are released as is and will most likely be subject to further tweaking in the future.</p>\r\n<p>Corresponding sets of overlay textures are forthcoming as well. If you want to stay up to date on progress please visit my thread, which is also the placeto be if you have questions and/or remarks otherwise.</p>\r\n<p>\_</p>\r\n<p><strong>Vortexture 2\_ - Grass &amp; Dirt v2</strong></p>\r\n<p>This download contains various sets of overlay and two-toned base textures based on the previously released set of base textures, for use in the Lot Editor. Included are:</p>\r\n<p>6 sets of grass overlays, 48 shapes per set<br>6 sets of dirts overlays, 48 shapes per set<br>5 sets of unpaved overlays, 32 shapes per set<br>8 sets of two-tone base textures, 48 shapes per set</p>\r\n<p>As always textures are released - as is - and may be subject to further tweaking in the future.</p>\r\n<p>If you want to stay up to date on progress please visit my thread, which is also the place to be if you have questions and/or remarks otherwise.</p>\r\n<p><u>Installation</u>: Copy/Extract the <strong>Vortext </strong>parent folder inside the plugins folder. (Documents/SimCity 4/Plugins) The <em>~Documents</em> folder contains the readme and a test lot to see the textures in the game as a test.</p>\r\n<p>\_</p>\r\n<p>Enjoy!</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/Vortexture 1_lex pic vrtxtr  day.jpg\" data-lightbox=\"lightbox168\" data-alt=\"lightboxVortexture 1_lex pic vrtxtr  day.jpg|Vortexture 2_lex pic vrtxtr2v2  day\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/Vortexture 1_lex pic vrtxtr  day.jpg\" alt=\"Vortexture 1_lex pic vrtxtr  day\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/Vortexture 2_lex pic vrtxtr2v2  day.jpg\" data-lightbox=\"lightbox168\" data-alt=\"lightboxVortexture 1_lex pic vrtxtr  day.jpg|Vortexture 2_lex pic vrtxtr2v2  day\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/Vortexture 2_lex pic vrtxtr2v2  day.jpg\" alt=\"Vortexture 2_lex pic vrtxtr2v2  day2\" ></a> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
