      - sc4evermore/2-network-addon-mod
    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>\_</p>\r\n<div>\r\n<p>This upload has become now the <strong>official release of the Real RailWay (RRW) Reskin 3rd Party Lot Support</strong> and it is replacing the former and by now obsolete <em>NCD-BSC RealRailway Texture Pack by eggman121 and rivit </em>(<strong>both the older V1 and recently made V2 update has become superseded by this update</strong>)</p>\r\n</div>\r\n<div>\r\n<p>This is the updated version of the original <em>NCD Real Railway Texture Override Pack by eggman121</em>, as the original one became a bit outdated. This update contains the more coherent and up to date version of the RRW Reskin 3rd party Lot Supports by rivit, MGB and eggman121. The original files were replaced with the Reskin Kit LotSupport versions and the install folder is now identical with the RRW Reskin folder. Bear in mind this override set is only compatible with the original RealRailway (brownish) texture set. For alternative colour re-skins use the RRW Reskin Kit.</p>\r\n</div>\r\n<div>\r\n<p>For removing the outdated/old versions you will find the <em>Cleanitol_RRW 3rd Party Lot Support v3.48.txt</em>. Run the script with one of the third party Cleanitol Tools:\_</p>\r\n</div>\r\n<div>\r\n<p><a href=\"https://community.simtropolis.com/files/file/35790-sc4-cleanitol/\" target=\"_blank\" rel=\"noopener\">nos.17 Cleanitol</a>\_(new tool)</p>\r\n<p><a href=\"https://sc4evermore.com/index.php/downloads/download/30-gameplay-utilities/18-bsc-cleanitol\" target=\"_blank\" rel=\"external nofollow noopener\"><abbr title=\"BATT Squad Certification\">BSC</abbr>\_Cleanitol</a>\_(old tool)</p>\r\n</div>\r\n<div>In order to make the RRW Reskin (a project to enable the recoloring of the Real Railway) a set of Lot Textures has been created for the Original RRW texture colours. With the help of a number of modders (spotting, making and testing) a very comprehensive coverage has been achieved - roughly 1100 textures.<br><br>Older lot textures were made with the Maxis Rail in mind. This set contains RRW versions of those textures. They will not be perfect as they have been algorithmically redrawn. However they match in color, guage and positioning.<br>If when using them you discover very poor quality please let us know so we can fix them.<br><br>The Set contains support for Rail Textures for lots using textures by the following authors:<br>\_<br>\_NAM core, BSC (incl jes), Cogeo, MGB, PEG, NCD, NOB, APTX, Simmer2 and WMP sets of Lot Textures containing Rail.\_ \_<br><br></div>\r\n<h3>Contents</h3>\r\n<div>This download contains RRW Override files for:</div>\r\n<div>\_</div>\r\n<ol>\r\n<li><a title=\"SC4Evermore\" href=\"/index.php/downloads/download/246-ncd-railyard-texture-mega-pack-vol01-v3\" target=\"_blank\" rel=\"noopener\"><em>NCD Railyard Texture Mega-Pack Vol01</em></a> (v3) (<a title=\"Rail Yard and Spur Textures Mega Pack 1 on STEX\" href=\"https://community.simtropolis.com/files/file/15976-rail-yard-and-spur-textures-mega-pack-1/\" target=\"_blank\" rel=\"noopener\">Railyard Texture Mega-Pack Vol 1.dat</a>*, <s>Railyard Texture Mega-Pack Vol 102.dat</s> and <a title=\"STEX\" href=\"https://community.simtropolis.com/files/file/22325-ncd-railyard-texture-mega-pack-vol01-v3/\" target=\"_blank\" rel=\"noopener\">Railyard Texture Mega-Pack Vol01 v3.dat</a>)<strong><br>RealRailway_ReSkin_LotSupport_NCD.dat</strong></li>\r\n<li><em>Various rail related textures (most of them) that can be found in the <a title=\"BSC Common Dependencies\" href=\"/index.php/downloads/download/22-dependencies/3-sc4d-lex-legacy-bsc-common-dependencies-pack\" target=\"_blank\" rel=\"noopener\">BSC Textures packs</a></em><a title=\"BSC Common Dependencies\" href=\"/index.php/downloads/download/22-dependencies/3-sc4d-lex-legacy-bsc-common-dependencies-pack\" target=\"_blank\" rel=\"noopener\"> (vol01-vol03)</a>**<strong><br>RealRailway_ReSkin_LotSupport_BSC.dat</strong></li>\r\n<li><em>APTX island type railstation textures</em> (8590_RailTexture.dat), <em>that can be found in the</em> <a href=\"/index.php/downloads/download/22-dependencies/142-aptx-ultra-prop-pack\" target=\"_blank\" rel=\"noopener\">APTX Textures Vol01.dat</a><br><strong>RealRailway_ReSkin_LotSupport_APTX.dat</strong></li>\r\n<li><em>Various rail related textures from Cogeo.</em><br><strong>RealRailway_ReSkin_LotSupport_Cogeo.dat</strong></li>\r\n<li><em>Various rail related textures from MGB204/rsc204</em><br><strong>RealRailway_ReSkin_LotSupport_MGB.dat</strong></li>\r\n<li><em>Various rail related textures from NOB, that can be found in the</em> <a href=\"/index.php/downloads/download/22-dependencies/11-sc4d-lex-legacy-nob-dependencies-pack\" target=\"_blank\" rel=\"noopener\">NOB Texture Pack Vol01_v2.dat</a> (former Ftextures)<br><strong>RealRailway_ReSkin_LotSupport_NOB.dat</strong></li>\r\n<li><em>Various rail related textures from Pegasus a.k.a. PEGPROD, that can be found now in the</em> <a title=\"PEG-MTP SUPER PACK\" href=\"https://community.simtropolis.com/files/file/20966-peg-mtp-super-pack/\">PEG-SUPER_TEXTURES.dat</a><br><strong>RealRailway_ReSkin_LotSupport_PEG.dat</strong>***</li>\r\n<li><em>Various rail related textures from Simmer2. Simmer2 has already created his textures for RRW in mind, but used custom colours, wearing etc.. These Reskin overrides in this DAT are transition textures between his RRW textures and whatever RRW Reskin is in use by the player.</em><br><strong>RealRailway_ReSkin_LotSupport_Simmer2.dat</strong></li>\r\n<li><em>Various rail related textures created by the WMP Team, that can be found in the</em> <a title=\"STEX\" href=\"https://community.simtropolis.com/files/file/33626-wmp-mega-textures-v102/\">WMP Mega Textures v1.02</a>. <br><strong>RealRailway_ReSkin_LotSupport_WMP.dat</strong></li>\r\n<li><em>These are the rail related lot support textures that came with the base game or added by the</em> <em>Network Addon Mod</em>. <br><strong>RealRailway_ReSkin_LotSupport_CORE.dat</strong>****</li>\r\n</ol>\r\n<div>\_<br>*The <em>Rail Yard and Spur Textures Mega Pack 1</em> on STEX is an outdated legacy texture set. It is highly NOT recommended to be used for LOT making. <strong><span style=\"color: #e03e2d;\">Use instead the NCD Railyard Texture Mega-Pack Vol01 v3</span></strong>.</div>\r\n<div>**The BSC Texture Packs are part of the BSC Common Dependencies Pack and they are still needed since only the rail related textures were updated! So Please keep these file in</div>\r\n<div>your plugins folder!<br>***The <em>RealRailway_ReSkin_LotSupport_PEG.dat</em> is (more or less) identical with the <em>PEG-SUPER_TEXTURES_RRWOverride.dat</em> that was released with the <a href=\"https://community.simtropolis.com/files/file/35353-pegasus-cdk3-collection/\" target=\"_blank\" rel=\"noopener\">Pegasus CDK3 Collection</a>. <br>****A more or less\_ identical version of this file (<em>RealRailway_Textures_LotSupport.dat</em>) can also be found in the <a href=\"/index.php/downloads/download/6-network-addon-mod-nam/2-network-addon-mod\" target=\"_blank\" rel=\"noopener\">Network Addon Mod</a>.</div>\r\n<div>\_</div>\r\n<div>This update is highly recommended for anyone who is using the Real Railway and wishes for NCD Lots to conform</div>\r\n<div><br>\r\n<h3>Change Log</h3>\r\n<ul>\r\n<li>The former <em>NCD-BSC RealRailway Texture Pack by eggman121 and rivit</em> (both the older V1 and recently made V2 update) has become superseded by this upload, which is the official <strong><span style=\"color: #e03e2d;\">Real RailWay (RRW) Reskin 3rd Party Lot Support</span>\_</strong></li>\r\n<li>The <strong>APTX </strong>files are the latest addition (found by Tyberius06)</li>\r\n<li>the <strong>jes </strong>files have been merged into the BSC files (req. Tyberius06)</li>\r\n<li>a number of <strong>NCD102 </strong>textures have received corrected IIDs (found by Tyberius06)</li>\r\n<li>The <strong>RealRailway_ReSkin_LotSupport_PEG.dat</strong> now has become (more or less) identical with the <em>PEG-SUPER_TEXTURES_RRWOverride.dat</em> that was released with the <a href=\"https://community.simtropolis.com/files/file/35353-pegasus-cdk3-collection/\" target=\"_blank\" rel=\"noopener\">Pegasus CDK3 Collection</a></li>\r\n</ul>\r\nas a consequence of these changes, both versions have changed (from v2.47 to v3.48) and previous installs should be removed first before putting this in place. <br><br>\r\n<h3>Installation</h3>\r\nAs these are scattered throughout a number of Mods, Megapacks, Lots and .dats, these Lot Support files need to go after their likely (default) place in the loading sequence. This set should therefore be placed in a special folder Plugins/<strong>Z___RRW Reskin</strong> i.e. as in this archive. Normally you do this by copying the contents of this Archive directly into User/Plugins as the folder structure is already included. <br><br>If you have Lots that use rail that load after this place in the plugins folder they will not display the RRW textures. <br><br>Plugins/Z___RRW Reskin/LotSupport is the default home of all RRW (reskin) Lot Support files.<br><br></div>\r\n<div>If you experience any issues with these packs you can post in the applicable thread at <a href=\"https://discordapp.com/invite/NsNZHEC\">SC4Evermore Discord</a>.</div>\r\n<div>\_</div>\r\n<div>\r\n<h3>Credits</h3>\r\n</div>\r\n<div>\_The following people have had a substantial hand in this work!</div>\r\n<div>eggman121 \"Updating the packs to RRW standard\"</div>\r\n<div>North Country Dude (NCD) \"For the initial work foundation\"</div>\r\n<div>Rivit \"For the excellent set of tools to make this update possible</div>\r\n<div>MGB204 \"For help in using the tools Rivit provided\"</div>\r\n<div>The BSC Team \"For Initial work foundation\"</div>\r\n<div>Swordmaster \"For the initial RRW project\"<br><br>Jan 2024 rivit, MGB204, Eggman121, Simmer2 and Tyberius06</div> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/NCD-BSC RealRailway Texture Pack V1-01.jpg\" data-lightbox=\"lightbox207\" data-alt=\"lightboxNCD-BSC RealRailway Texture Pack V1-01.jpg|NCD-BSC RealRailway Texture Pack V1-02\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/NCD-BSC RealRailway Texture Pack V1-01.jpg\" alt=\"NCD-BSC RealRailway Texture Pack V1-01\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/NCD-BSC RealRailway Texture Pack V1-02.jpg\" data-lightbox=\"lightbox207\" data-alt=\"lightboxNCD-BSC RealRailway Texture Pack V1-01.jpg|NCD-BSC RealRailway Texture Pack V1-02\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/NCD-BSC RealRailway Texture Pack V1-02.jpg\" alt=\"NCD-BSC RealRailway Texture Pack V1-022\" ></a> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
