    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>This is a props pack that regroup 130 french road signs in 90ยฐ degree version.<br>For LOTters, these props are available in Lot Editor Ptops Section's, under the name:\_<b>SignFR...</b><br>Special thanks to\_<b>BSC</b>\_<b>/ TSC Members</b>.</p>\r\n<p class=\"textnormal\"><b><span lang=\"EN-US\">Installation:</span></b><span lang=\"EN-US\"> copy/extract the BSC parent folder into your plugins. If you extracted the <em>~Documents</em> folder into your plugins, too, it's highly recommended to keep it, but move it out of the Plugins folder.</span></p>\r\n<p class=\"textnormal\"><b><span lang=\"EN-US\">Un-Installing:\_</span></b><span lang=\"EN-US\">To un-install the files, simply bulldoze every lot from this download in your cities and delete the files from the plugins folder afterwards.</span></p>\r\n<p class=\"textnormal\">\_</p>\r\n<p class=\"textnormal\"><span lang=\"EN-US\"><strong>Dependencies</strong>:</span></p>\r\n<p class=\"textnormal\">Note: few props use\_darknite\_version from Simfox</p>\r\n<p class=\"textnormal\"><a href=\"https://community.simtropolis.com/files/file/23089-simfox-day-and-nite-modd/\">SimFox Day and Nite Modd</a></p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/icon panneau.jpg\" data-lightbox=\"lightbox214\" data-alt=\"lightboxicon panneau.jpg|Sans titre\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/icon panneau.jpg\" alt=\"icon panneau\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/Sans titre.jpg\" data-lightbox=\"lightbox214\" data-alt=\"lightboxic