    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>Here it is... the waited S54 PropPack Vol.1 from the KSTeam. This propack includes many props I use in my own LOTs and Krasner use too. It'll be very usefull to make your LOTs more frenchy or just european... this download includes a file .dat which groups prop families from Girafe vehicules. So the following sentence is very important !</p>\r\n<p><span style=\"color: #e03e2d;\"><strong>THIS DEPENDENCY HAS GOT ANOTHER DEPENDENCY !!!!</strong></span></p>\r\n<p>Make sure that you have these following files BEFORE downloading this one:</p>\r\n<p><a href=\"https://sc4evermore.com/index.php/downloads/download/22-dependencies/3-sc4d-lex-legacy-bsc-common-dependencies-pack\">SC4D LEX Legacy - BSC Common Dependencies Pack v8</a>\_(and above)<br>The below listed dependencies are all can be found in the hereby linked dependency pack compilation.</p>\r\n<ul>\r\n<li>BSC-VIP Girafe Carpack vol01-vol02 v2 (Original)</li>\r\n<li>BSC-VIP Girafe Carpack vol03 v2</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><strong>Installation</strong></span>: Copy/extract the <strong>KSTeam </strong>parent folder into your Plugins. If you extracted the\_<em>~Documents</em>\_folder into you plugins too, it's highly recommended to keep it, but move it out of the Plugins folder.</p>\r\n<p>Thank you for reading and enjoy this prop pack. Next uploads will come in the next days. Stay tuned..</p>\r\n<p><em>Sciurus from KSTeam</em></p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/IMGS54PropPack.jpg\" data-lightbox=\"lightbox234\" data-alt=\"lightboxIMGS54PropPack.jpg|KSTeam S54 - Prop Pack Vol01_index\" target=\"_blank\"><img class=\"jd_image-left\" src=\"h