Remastered - both use separate IIDs)</li>\r\n<li>BSC VIP Girafe Carpack Vol03\_v2 - <strong><span style=\"color: #f1c40f;\">updated to v2 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC VIP Girafe Carpack Vol04<strong><span style=\"color: #2dc26b;\">\_- updated in BSC Common Dependencies Version 9b</span></strong></li>\r\n<li>BSC VIP Girafe Urbanpack Vol01 - <strong><span style=\"color: #f1c40f;\">see detailed information in the CHANGELOG in the Readme</span></strong></li>\r\n<li>BSC VIP Girafe Hedges\_-\_<strong><span style=\"color: #e67e23;\">ADDED: new pack in\_BSC Common Dependencies Version 7</span></strong></li>\r\n</ol>\r\n<h4>Texture Packs</h4>\r\n<ol start=\"182\">\r\n<li>BSC Textures Vol01</li>\r\n<li>BSC Textures Vol02</li>\r\n<li>BSC Textures Vol03\_v4 - <strong><span style=\"color: #f1c40f;\">updated to v4 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC TexturePack Cycledogg V01 -\_<span style=\"text-decoration: underline;\"><em>It is the same as V01b (as it was named on the LEX download page)</em></span></li>\r\n</ol>\r\n<h4>Other</h4>\r\n<ol start=\"186\">\r\n<li><span style=\"text-decoration: line-through;\">BSC_PropFamilyNames\_v3 - updated to v3 in BSC Common Dependencies Version 7</span><strong><span style=\"color: #f1c40f;\"><br></span><span style=\"color: #2dc26b;\">BSC_PropFamilyNames v4 - updated to v4 in BSC Common Dependencies Version 9a</span></strong></li>\r\n<li><strong><span style=\"color: #ba372a;\"><s>CP_Essentials_FamilyNames</s>\_-\_REMOVED:</span></strong>\_it has been merged into\_<strong><span style=\"color: #f1c40f;\">BSC_PropFamilyNames\_v3</span></strong></li>\r\n</ol>\r\n<p>Various pieces of original documentation and completely reworked and updated new individual Cleanitol definitions\_can be found in the \"<em>~Documents</em>\" folder in the main ZIP, which, while installed in the Plugins directory, should be removed. The installer by default no longer installs these additional documentation files.</p>\r\n<p>\_</p>\r\n<p><span style=\"font-size: 24px;\"><strong>Credits</strong></span></p>\r\n<p>The following BSC members contributed models, textures, and modding support to this collection. Parentheses indicate the initials they used on their files (some initials are for projects, like SNM for SimNation Military, and WFK for Waterfront Kit):</p>\r\n<ul>\r\n<li>BarbyW (BLS)</li>\r\n<li>Caliban</li>\r\n<li>callagrafx (CAL)</li>\r\n<li>Cerulean (CARCH)</li>\r\n<li>ChrisAdams3997 (ALN)</li>\r\n<li>Citynut (NewmanInc/CNut)</li>\r\n<li>Cobb32118 (COBB)</li>\r\n<li>Couchpotato (MJB)</li>\r\n<li>Colyn (CSX)</li>\r\n<li>cycledogg/c.p. (CP)</li>\r\n<li>deadwoods (DAE/DEDWD)</li>\r\n<li>DebussyMan (DBSSYMN)</li>\r\n<li>Dolphin66 (D66)</li>\r\n<li>Don Miguel</li>\r\n<li>GaryReggae (GAZ)</li>\r\n<li>Gascooker (GC)</li>\r\n<li>geoffhaw</li>\r\n<li>Girafe (Grfe)</li>\r\n<li>GrampaAl (GA)</li>\r\n<li>JBSimio (JBS)</li>\r\n<li>jen_p</li>\r\n<li>jeronij (JRJ)</li>\r\n<li>jestarr (JES)</li>\r\n<li>JMyers2043</li>\r\n<li>jplumbley</li>\r\n<li>kevdan25</li>\r\n<li>Kwakelaar (KWK)</li>\r\n<li>Lilith (LiL)</li>\r\n<li>M4346</li>\r\n<li>Mattb325</li>\r\n<li>Mickebear (MBEAR)</li>\r\n<li>Mikeseith</li>\r\n<li>prepo</li>\r\n<li>RippleJet (RJ)</li>\r\n<li>Ripptide (RT)</li>\r\n<li>Rubik3</li>\r\n<li>SimGoober (SG)</li>\r\n<li>swi21</li>\r\n<li>tag_one (T1)</li>\r\n<li>vester (VDK)</li>\r\n<li>xannepan (JENX)</li>\r\n<li>Yoder7652 (YDR)</li>\r\n</ul>\r\n<p>This package has been made possible by the Project ZIP efforts of Tyberius06, and was assembled by Tarkus. Cleanitol definition provided by Ulisse Wolf and Tyberius06.</p>\r\n<p>Please note that this pack <strong>is</strong> expected to receive updates in the near future. Do not redistribute without asking first, mostly as doing so would complicate efforts to properly maintain, update, and provide technical support for the pack.</p>\r\n<p><strong><span style=\"font-size: 24px;\">INSTALLATION</span></strong></p>\r\n<p>This package utilizes a Java-based installer (similar to the one used with the Network Addon Mod), and can also be opened and installed manually using 7-Zip or Keka.</p>\r\n<p>To install it, you'll either need the Java Runtime Environment to run the installer--<a href=\"https://adoptium.net/temurin/releases\">Adoptium's open-source edition is recommended</a>--or a zip tool capable of opening the installer to allow manual installation. For Windows/Linux, use <a href=\"https://www.7-zip.org\">7-zip</a>, and for macOS, use <a href=\"https://www.keka.io/en/\">Keka</a>.</p>\r\n<p>Once into the installer, after agreeing to the terms for the package, click to the Files tab to select which dependencies you wish to install (making no changes here will install everything). Then, click to the Location tab to set up an installation location (this should be the root of your My DocumentsSimCity 4Plugins folder). After this, click over to the Install tab, and click \"Start installation\" to begin the installation procedure. When installation is complete, the tab pop up a message indicating it, after which you are safe to close the installer.</p>\r\n<p><strong>It is highly recommended to run the cleanitol with the installer and remove any previous versions from your plugins.</strong><br>Optionally in the\_<em>~Documents\_</em>folder in the main ZIP you can find the\_<span style=\"text-decoration: underline;\">all the individual cleanitol</span> files\_and by using either the newer\_<strong><a href=\"https://community.simtropolis.com/files/file/35790-sc4-cleanitol/\">nos.17's SC4 Cleanitol</a>\_</strong>or the older\_<strong><a href=\"/index.php/downloads/download/30-gameplay-utilities/18-bsc-cleanitol\">BSC Cleanitol</a>\_</strong>tool you can search and remove old and outdated versions of these files.</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">