    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>Fantozzi's Audio Essentials is a dependency that contains handcrafted game adequate and broadly usable custom query sounds.</p>\r\n<p>Dear lotters for your convenience query IDs are listed in the included pdf-file.Please use Ilives Readers listening function to check out the sounds.\_</p>\r\n<p>Dear players you need lot files first that call the query sounds - otherwise this file won't do anything for you.</p>\r\n<p><em><strong>This game content was created (partially) with third party content, amongst this also commercial samples which I legaly purchased and am allowed to use in my creative work. <span style=\"font-size: 1rem;\">Therefore you aren't allowed to extract and resample/reuse parts of the audio material itself encoded in the dat-file. This may infringe the copyrights of third persons/companies (see credits section in the readme). This means: you are allowed to use the contained audio data only in conjunction with the game it was designed for. This disclaimer you find also in the documentation included in the zip-file.</span></strong></em></p>\r\n<p><em>Update to Version 1.3: Added 9 new sounds dedicated to chemical industry and boiling (gascooking) traffic and others. Again fixed few errors, adjusted some sample rates (playing speed).</em></p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
