    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>This package contains modular rail depot models, rail service platforms plus props (linked to automata) and textures to use with them.\_</p>\r\n<p>Whilst the idea of this package is to allow lotters to use them making Rail Depots, there are a number of user-customisable features, that any lots created with this resource can take advantage of.\_</p>\r\n<p><em><strong>The main depot props have been rendered in three different ways. Two HD versions, containing higher-res textures, with either Maxis Nite or Dark Nite variants. There is also an SD Maxis Nite version for those who dislike/can't use HD models.</strong></em></p>\r\n<p>The textures included can be customised during installation to support many different configurations. The automata props are linked to the installed automata for Rail, HSR/Monorail and GLR/EL-Rail. This means lots using them will show a users installed automata on them (limitations apply). The Depot and Automata props are provided additionally in three timed groups, for more variation.\_</p>\r\n<p><br><em>See the included readme for further details, this is installed in My DocumentsSimCity 4LEX_DownloadsMGB Mods so it doesn't clutter up your plugins folder.\_</em></p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/RDP_1.jpg\" data-lightbox=\"lightbox92\" data-alt=\"lightboxRDP_1\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/RDP_1.jpg\" alt=\"RDP_1\" ></a> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
